import NavebarPage from '../../components/Utlity/NavebarLogin'
import Sliader from '../../components/Home/Sliader'
import HomeCategory from '../../components/Home/HomeCategory'
import ProdactCardContiner from '../../components/Prodact/ProdactCardContiner'
import Dicount from '../../components'
function HomePage() {
    return (
      <div className="font" >
        <NavebarPage/>
        <Sliader/>
        <HomeCategory />
        <ProdactCardContiner title="الاكثرمبيعا" btntitle="المزيد"/>
        <Dicount />
        <ProdactCardContiner title="الاكثر تقييما" btntitle="المزيد"/>
        
      </div>
    );
  }
  
  export default HomePage;
